description:
Emperor of the Seas

History Documentary hosted by David Kersten, published by Arte in 2006 - English narration


Information
------------------------------

The compelling tale of one of China's greatest naval heros, a Muslim eunuch who is said to have led an armada halfway across the world on behalf of the ming Emperor

